                     "device": vdo.device,
                     "logical_size": vdo.logicalSize,
                     "physical_size": vdo.physicalSize,
                     "index_mem": vdo.indexMemory,
                     "activated": vdo.activated,
                     "compression": vdo.enableCompression,
